import logo from './../logo.svg';
import './../App.css';
import CVList from "./cv.list";
import Grade from "./dashboard.gradelist";

function Skills() {
    return <div>
        <div className="max-w-2xl mx-auto px-1 pb-8 sm:px-6 lg:px-8 bg-gray-200">
            <Grade />
            <div class="flex justify-start cursor-pointer text-gray-700 hover:text-blue-400 hover:bg-blue-100 rounded-md px-2 py-2 my-2">
                <span class="bg-green-400 h-2 w-2 m-2 rounded-full"></span>
                <div class="flex-grow font-medium px-2">Jeffrey Wey</div>
                <div class="text-sm font-normal text-gray-500 tracking-wide">Member</div>
            </div>
            <div class="flex justify-start cursor-pointer text-gray-700 hover:text-blue-400 hover:bg-blue-100 rounded-md px-2 py-2 my-2">
                <span class="bg-green-400 h-2 w-2 m-2 rounded-full"></span>
                <div class="flex-grow font-medium px-2">Jeffrey Wey</div>
                <div class="text-sm font-normal text-gray-500 tracking-wide">Member</div>
            </div>
        </div>
    </div>
}
export default Skills;
